a:260:{i:0;a:1:{s:2:"id";s:19:"2391238443828479327";}i:1;a:1:{s:10:"short_code";s:11:"CEvYrIBp4Vf";}i:2;a:1:{s:12:"created_time";i:1599277857;}i:3;a:1:{s:7:"caption";s:1890:"Quebre la rutina.
Entre los vestigios de luz exterior, prendi tabaco mentolado, y sali a la noche con mi gato.
Negros ambos, en las sombras, fuimos dos seres agazapados bajo el follaje. 
El complejo habitacional estaba finalmente en silencio, bien entrada la madrugada.
Solo el ruido de algunos motores, y las ultimas hojas muertas cayendo sobre las piedras.
Mire a la nada, y desenfoque la vista. La luz de la luna se colaba timidamente entre los arboles, alumbrandonos. 
Tengo las manos congeladas... el invierno no se quiere ir y asalta el calor de mi cuerpo.
Por primera vez, a semana y media de la despedida, me animo a enfrentarme con el espejo. No se muy bien por donde empezar. Tengo conmigo un alfajor y un par de pañuelos, por las dudas llegue esa tormenta inminente que vengo guardando desde entonces. 
Fueron dias sin sol y sin estrellas, hoy hubo ambos. 
Los pensamientos se agolpan, me azotan, la caja de pandora se abrió. El caos se hace vida, es un hervidero de sonido. 
Los primeros mosquitos aletean alrededor de mis piernas... no me importan. Pueden tomar la sangre que quieran de mis heridas abiertas. 
El gato mueve las orejas, me alerta de cosas que no veo ni escucho. Fantaseo un poco con verte llegar, y compartir esto con vos. Los silencios jamas fueron incomodos de tu mano... no hacia falta llenar nada con palabras. Solo tu mano y mi mano eran suficientes, a ojos cerrados, para despegar de la realidad. 
Siento el pecho hinchado de cosas que quiero decirte, y los ojos llenos de besos liquidos que se quedaron sin destino. 
Caeran al cementerio de cristales, con otras frustraciones... 
Las despedidas se mezclan con las sombras en una sola amalgama de negros, no hay luna que aguante, no hay mañana tras el horizonte.
.
